import CsvUpload from './CsvUpload'
import React, { useState } from 'react'


const Entry = () => {
    const [myData, setMyData] = useState({})

    const convertToObject = (anArray) => {
        let objectArray = []
        const myInputArray = anArray.data

        myInputArray.forEach(game => {
            // console.log(game)
            const myGame = {}
            for (let i = 0; i < game.length; i ++) {
                myGame[myInputArray[i]] = game[i]
            }
            objectArray.push(myGame)
        })
        console.log(objectArray)

    }
    return(
        <div>
        Hi
        <CsvUpload setMyData = {convertToObject}/>

        {myData.map}
        </div>
    )
}

export default Entry
